import Header from "../components/Header";
import styles from "./ProjectsPage.module.css";

const ProjectsPage = () => {
  return (
    <div className={styles.projectsPage}>
      <img
        className={styles.projectsPageChild}
        alt=""
        src="/Atlas.png"
      />
      <div className={styles.monkeyDLufy}>Atlas - ecommerce Website</div>
      <div className={styles.rectangleParent}>
        <img className={styles.frameChild} alt="" src="/Atlas_products.png" />
        <img className={styles.frameItem} alt="" src="/rectangle-241@2x.png" />
        <img className={styles.frameChild} alt="" src="/rectangle-251@2x.png" />
        <img className={styles.frameChild} alt="" src="/rectangle-26@2x.png" />
      </div>
      <div className={styles.loremIpsumDolorContainer}>
        <p className={styles.loremIpsumDolor}>
        This eCommerce website project is a comprehensive online platform <br/> designed to deliver a seamless and intuitive shopping experience. <br />Developed using the latest web technologies, it integrates a robust back-end system with an attractive and responsive front-end interface. The website features advanced search and filtering options, secure payment gateways, and a user-friendly checkout process. Tailored to meet the needs of modern consumers, this project emphasizes speed, security, and accessibility, ensuring that users can easily find and purchase products with confidence. With a focus on scalability, the platform is designed to grow alongside the business, accommodating an expanding inventory and a growing customer base.</p>
      </div>
      <div className="navbar">
        <Header />
      </div>
    </div>
  );
};

export default ProjectsPage;
